Опкоды из библиотеки CLEO (CLEO 4 или CLEO для GTA III и Vice City) не поддерживаются. Но CLEO Redux добавляет свои новые опкоды для некоторых операций. 0C00 IS_KEY_PRESSED 0C01 INT_ADD 0C02 INT_SUB 0C03 INT_MUL 0C04 INT_DIV 0C05 TERMINATE_THIS_CUSTOM_SCRIPT 0C06 WRITE_MEMORY ( UNSAFE - требует mem разрешение) 0C07 READ_MEMORY ( UNSAFE - требует mem разрешение) 0C08 CALL_FUNCTION ( UNSAFE - требует mem разрешение) 0C09 CALL_FUNCTION_RETURN ( UNSAFE - требует mem разрешение) Обратите внимание, что Sanny Builder еще не поддерживает эти новые коды операций «из коробки». Чтобы включить новые коды операций в ваших сценариях CS, добавьте следующие строки поверх вашего сценария: {$O 0C00=1, is_key_pressed %1d% }
{$O 0C01=3,%3d% = %1d% + %2d% }
{$O 0C02=3,%3d% = %1d% - %2d% }
{$O 0C03=3,%3d% = %1d% * %2d% }
{$O 0C04=3,%3d% = %1d% / %2d% }
{$O 0C05=0,terminate_this_custom_script }
{$O 0C06=5,write_memory %1d% size %2d% value %3d% virtual_protect %4d% ib %5d% }
{$O 0C07=5,%5d% = read_memory %1d% size %2d% virtual_protect %3d% ib %4d% }
{$O 0C08=-1,call_function %1d% ib %2d% num_params %3d%}
{$O 0C09=-1,call_function_return %1d% ib %2d% num_params %3d%}

